Let me think through this step by step...

The key psychological mechanisms involved in responder behavior in this bargaining game are fairness and self-interest.  Responders likely consider the fairness of the proposed split relative to their contribution and the opponent's contribution, as well as the absolute monetary gain they would receive by accepting.  The fairness consideration can be influenced by both the percentage split and the absolute difference in monetary amounts.

These mechanisms interact in a way that a responder might accept an unfair offer if the absolute gain is sufficiently high. Conversely, even a relatively fair offer (in percentage terms) might be rejected if the absolute gain is too low, especially if the proposer has contributed considerably more than the responder.

A mathematical form that captures these interactions could be a linear combination of a fairness term and a self-interest term, weighted by learnable parameters. The fairness term could incorporate both percentage difference and the absolute difference in proposed amounts, adjusted for contributions. The self-interest term would simply be the proposed amount for the participant.

The parameters needed are:

1.  `fairness_weight`:  This parameter determines the relative importance of fairness compared to self-interest. A higher value indicates a greater preference for fairness.
2.  `fairness_sensitivity`: This parameter determines how sensitive the responder is to perceived unfairness (i.e., how much the fairness evaluation changes in response to differences in contributions or splits).

The model variables map to observable behavior as follows:  the utility of acceptance is calculated using the formula, and the acceptance probability would then be derived (later, using a temperature parameter). Higher utility values would correspond to a higher probability of acceptance.


