def simulate_model(trial_data, fairness_weight=1, self_interest_weight=1):
    utility_values = []
    for trial in trial_data:
        try:
            fairness_term = fairness_weight * (trial['splitperc_self'] - (trial['combined_earning'] / (trial['token_self'] + trial['token_opp'])) * 100)
            self_interest_term = self_interest_weight * trial['split_self']
            utility = fairness_term + self_interest_term
            utility_values.append(utility)
        except (KeyError, ZeroDivisionError) as e:
            print(f"Error processing trial {trial.get('ID', 'unknown')}: {e}")
            utility_values.append(float('nan')) #Handle missing data or division by zero gracefully

    return utility_values
